import React from 'react';
import '../App.css';

const HeroCard = ({hero}) => {   
    return (
        <div className='card'>
            <img src={`https://api.opendota.com${hero.img}`}></img>
            <h1>{hero.localized_name}</h1>
        </div>
    )
}

export default HeroCard;
